import React, { useState } from "react";

const InputElement = () => {
  const [input, setInput] = useState("");

  return (
    <input
      onChange={(e) => {
        setInput(e.target.value);
      }}
      placeholder='Enter something'
    />
  );
};

export default InputElement;
